    $('body').on('click', '.fl_default', function () {
        $(".fl_default").change(function () {
            var filename = "<p class='uploaded-file'>";
            filename += ` 
                ${$(this)[0].files.length} 
                ${getEndgingWord($(this)[0].files.length, ['', '', ''])}`;
            filename += "</p>";
            $(".fl_nm")
                .html(filename)
                .addClass("selected_file");
        });
    });

    function getEndgingWord(n, text_forms) {
        n = Math.abs(n) % 100;
        let n1 = n % 10;
        if (n > 10 && n < 20) {
            return text_forms[2];
        }
        if (n1 > 1 && n1 < 5) {
            return text_forms[1];
        }
        if (n1 === 1) {
            return text_forms[0];
        }
        return text_forms[2];
    }

